title:
RMS ROMA - ex Europe   [contains correspondence relating to the following voyages: 
1. Departed Genoa 18 August 1951, arrived Melbourne 6 October 1951; 
2. Departed Genoa 1 December 1951, arrived Sydney 4 January 1952 (5 French assisted passage migrants);
 3. Departed Genoa 20 February 1952, arrived Melbourne 20 March 1952 (130 Italian assisted passage migrants); 
4. Departed Genoa 16 May 1952 arrived Brisbane c 22 June 1952 (1 migrant under Empire and Allied Servicemen Scheme);
5. Departed Genoa 18 September 1952, (arrival details not shown) (2 French family units totalling 5 persons under Empire and Allied Servicemans Scheme); 
6. Departed Naples 19 February 1953 arrived Melbourne 15 March 1953 (44 Displaced Persons, 21 German assisted passage migrants)]
